import React from "react";

const CallToAction = () => {
  return (
    <div>
      <section>
        <h1
          onClick={() =>
            window.open(
              "https://discordapp.com/oauth2/authorize?client_id=683749582705786882&scope=bot&permissions=2146958591"
            )
          }
        >
          Connect bot
        </h1>
        <p>To be developed</p>
      </section>
    </div>
  );
};

export default CallToAction;
